import React from 'react';
import { useState } from 'react';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Rating from '@mui/material/Rating';
import Alert from '@mui/material/Alert';



const Home = () => {
    return (
        <Box>
            <Typography variant="h5" gutterBottom>
                This will eventually take you to the Home (logged in) page
            </Typography >
            <Alert severity="success" onClose={() => { handleClose }}>
                This Alert displays the default close icon.
            </Alert>
            <Typography variant="h3" gutterBottom>
                Dining
            </Typography>
            <Typography variant="h5" gutterBottom>
                Open Now & Activity Level
            </Typography>
            <Typography variant="h6" gutterBottom>
                Epicuria <Rating size="small" name="Epicura Rating" value={5} readOnly />

            </Typography>
            <Typography variant="h6" gutterBottom>
                De Neve  <Rating size="small" name="De Neve Rating" value={1} readOnly />
            </Typography>
            <Typography variant="h5" gutterBottom>
                Open Later
            </Typography>
            <Typography variant="h6" gutterBottom>
                Bruin Plate  <Rating size="small" name="De Neve Rating" value={4} readOnly />
            </Typography>
            <Typography variant="h5" gutterBottom>
                Closed
            </Typography>

            <Typography variant="h3" gutterBottom>
                Gym
            </Typography>
            <Typography variant="h5" gutterBottom>
                Open Now & Activity Level
            </Typography>
            <Typography variant="h5" gutterBottom>
                Bruin Buddies
            </Typography>

            <Button variant="contained" href="/">
                Go back to home page :)
            </Button>
        </Box>

    );
};

const AlertComponent = () => {
    const [open, setOpen] = useState(true); // State to manage alert visibility

    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return; // Prevent closing on clickaway
        }
        setOpen(false); // Close the alert
    };
}
export default Home;
